import React from 'react'

import './AboutInforItemStyle.css'

export default function AboutInforItem({
    title,
    items
}) {
  return (
    <div>
 
    <p className="title">{title}</p>
        <div className="items">
            {items.map((item, index) => (
            <div className="item" key={index}>
              <p>{item}</p>
            </div>
            ))}
        </div>
  
        
    </div>

    
  )
}
